import React from "react";
import GenderCardStyle from "./GenderCardStyled";

const GenderCard = (props) =>
{
  const { gender } = props;
  console.log(gender);

  return(
  <GenderCardStyle>
    <div className="row">
      <h1>
        {gender}
      </h1>
    </div>
  </GenderCardStyle>
)
};

export default GenderCard;
